// import logo from './logo.svg';
import './App.css';
import { Map, Marker, GoogleApiWrapper, Polygon } from 'google-maps-react';
import React, { Component } from 'react';
import { Row, Col } from 'reactstrap';

class App extends Component {

  render() {
    const triangleCoords = [
      {lat: -6.2710423, lng: 106.7962754},
      {lat: -6.2715431, lng: 106.7951503},
      {lat: -6.2720115, lng: 106.7971688},
    ];

    return (
      <div className="App flex-column">
        <Col md="12">
          <Row className="mt-1">
            <div className="Maps">
              <Map google={this.props.google}
                  initialCenter={{lat: -6.2710423,lng: 106.7962754}}
                style={{width: '70%', height: '100%', position: 'relative'}}
                className={'map'}
                zoom={16}>
                <Polygon
                  paths={triangleCoords}
                  strokeColor="#0000FF"
                  strokeOpacity={0.8}
                  strokeWeight={2}
                  fillColor="#0000FF"
                  fillOpacity={0.35} />
                <Marker
                  title={'The marker`s title will appear as a tooltip.'}
                  name={'Vehicle'}
                  position={{ lat: -6.2715431, lng: 106.7951503 }} />
                <Marker
                  name={'Target1'}
                  position={{ lat: -6.2720115, lng: 106.7971688 }} />
                <Marker />
              </Map>
            </div>
          </Row>
          <Row className="mb-3">
          <div className="d-flex flex-column">
            <div className="p-2 col-example text-right">Flex item 1</div>
            <div className="p-2 col-example text-left">Flex item 2</div>
            <div className="p-2 col-example text-left">Flex item 3</div>
          </div>
          <div className="d-flex flex-column-reverse">
            <div className="p-2 col-example text-left">Flex item 1</div>
            <div className="p-2 col-example text-left">Flex item 2</div>
            <div className="p-2 col-example text-left">Flex item 3</div>
          </div>
          </Row>
        </Col>
      </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: ('AIzaSyBAefhRlXEH3vCko-zZTX6PHllTR6av4WI')
})(App)
